import React from "react";
import { Link } from "react-router-dom";
import Home from "../home/home";
const Navbar=()=>
{
    return(
        <nav>
            <div>
                <Link to='/'>Home</Link>
                <Link to='/about'>About</Link>
                <Link to='/contact'>Contact Us</Link>
            </div>
            <h2>Hello world</h2>
        </nav>
    )
}
export default Navbar;
